import Banner from "./components/banner/banner"
import Footer from "./components/footer/footer"
import Article from "./components/articles/articles"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Banner />
      </header>

      <section>
        <Article />
      </section>

      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default App;
